// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract BirdMigration {
    IERC20 public token;
    address public recipientAddr = 0x44f54A506330573FDc7B7e99AFdDEEd728eE089A;

    constructor(address tokenAddress) {
        token = IERC20(tokenAddress);
    }

    event TokensMigrated(uint256 amount, address indexed sender, address indexed recipient, string newTokenRecipient );

    function migrate(uint256 amount, string memory solanaAddr) external {
        require(amount <= token.allowance(msg.sender, address(this)), "Allowance not sufficient");
        require(amount <= token.balanceOf(msg.sender), "Balance not sufficient");
        
        token.transferFrom(msg.sender, recipientAddr, amount);
        emit TokensMigrated(amount, msg.sender, recipientAddr, solanaAddr);
    }
}

